import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to be rendered by the script
    await page.waitForSelector('.product-card .add-to-cart', { timeout: 5000 });

    // Locate the first "Add to Cart" button on the page
    const firstAddToCartButton = page.locator('button.add-to-cart').first();

    // Click the button to add the product to the cart
    await firstAddToCartButton.click();

    // Take a screenshot after clicking the button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_added.png'));

    // Verify the action by checking the underlying cart data model
    const cartData = await page.evaluate(() => {
      // Access the global 'cart' variable from the page's script.js
      if (window.cart) {
        return window.cart;
      }
      return null;
    });

    if (!cartData || cartData.length === 0) {
      throw new Error('Verification failed: Product was not added to the cart data array.');
    }

    return {
      success: true,
      action: "Clicked the 'Add to Cart' button for the first available product.",
      extractedData: {
        cartContents: cartData,
        cartItemCount: cartData.length,
        firstItemTitle: cartData[0].title,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
